{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/rachanamaguluri/careers-in-data-and-its-future?scriptVersionId=161953422\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"2c3dd93b","metadata":{"papermill":{"duration":0.016229,"end_time":"2024-02-06T17:53:36.896845","exception":false,"start_time":"2024-02-06T17:53:36.880616","status":"completed"},"tags":[]},"source":["# INTRODUCTION \n","\n","As a Master's student in Analytics, this case study offers a valuable opportunity to apply my academic learnings to real-world data, providing insights into the diverse landscape of job roles within the data domain. The dataset presents an in-depth look at various positions, salaries, and other job-related statistics that are essential for understanding current trends in the data job market.\n","\n","This analysis is not just an academic exercise; it's a pivotal exploration that informs future professionals—like myself—about the industry's direction, the value of different roles, and the competitive landscape of salaries and job settings. Given the dynamic nature of the data field, with its evolving technologies and methodologies, this case study stands as a crucial reference for students to align their educational paths with market demands."]},{"cell_type":"markdown","id":"cd5e728d","metadata":{"papermill":{"duration":0.014968,"end_time":"2024-02-06T17:53:36.92699","exception":false,"start_time":"2024-02-06T17:53:36.912022","status":"completed"},"tags":[]},"source":["# THE WORKFLOW\n","\n","Prior to working on the data set, I decided to follow a data workflow system to help me keep track and understand of what I was doing and trying to achieve. The steps are as follows. \n","1. Business questions - Objective\n","2. Data sourcing and Loading \n","3. Data Cleaning\n","4. Descriptive Statistics - Exploratory Data Analysis\n","5. Data Analysis of Main attributes\n","6. Key Findings\n"]},{"cell_type":"markdown","id":"d0e574a5","metadata":{"papermill":{"duration":0.014861,"end_time":"2024-02-06T17:53:36.95797","exception":false,"start_time":"2024-02-06T17:53:36.943109","status":"completed"},"tags":[]},"source":["# OBJECTIVE OF THE CASE STUDY\n","The objective of this case study is to understand the salary dynamics within the data analysis field, particularly how various factors such as job category, experience level, company location, size, and work setting influence compensation for entry-level positions.\n","\n","This case study is useful because it provides actionable insights for both job seekers and employers in the data analysis sector. For job seekers, especially those at the entry level, it highlights where and under what conditions they might find the most lucrative opportunities. For employers, it offers a benchmark to ensure competitive salary offerings and understand how different factors contribute to salary expectations, aiding in strategic hiring and retention practices.\n","\n","\n","\n"]},{"cell_type":"markdown","id":"8c16f0b3","metadata":{"papermill":{"duration":0.014976,"end_time":"2024-02-06T17:53:36.988689","exception":false,"start_time":"2024-02-06T17:53:36.973713","status":"completed"},"tags":[]},"source":["# DATA SOURCING\n","\n","The data is located at ai-jobs.net and entitled \"The Global AI, ML, Data Science Salary Index for 2023\" which is based on internal data survey submissions and jobs with open salaries, as the authors describe the data. The data is processed and updated every week. You can contribute to them by submitting your salary info.\n","\n","I have downloaded the data set from Murilo Zangari profile in [Kaggle](https://www.kaggle.com/code/murilozangari/jobs-and-salaries-in-data-related-careers/notebook), where you can find the data card, the Metadata, and the License.This case study was also inspired by his attempt on the data set."]},{"cell_type":"markdown","id":"73ea7719","metadata":{"papermill":{"duration":0.015268,"end_time":"2024-02-06T17:53:37.020475","exception":false,"start_time":"2024-02-06T17:53:37.005207","status":"completed"},"tags":[]},"source":["# DATA LOADING\n","\n","IMPORTING AND LOADING THE DATA \n","\n","The case study commenced with the crucial step of data loading. The dataset, jobs_in_data.csv, was imported into the R environment. "]},{"cell_type":"code","execution_count":1,"id":"2f9f594d","metadata":{"execution":{"iopub.execute_input":"2024-02-06T17:53:37.05681Z","iopub.status.busy":"2024-02-06T17:53:37.053803Z","iopub.status.idle":"2024-02-06T17:53:37.298692Z","shell.execute_reply":"2024-02-06T17:53:37.296603Z"},"papermill":{"duration":0.265994,"end_time":"2024-02-06T17:53:37.301543","exception":false,"start_time":"2024-02-06T17:53:37.035549","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A data.frame: 6 × 12</caption>\n","<thead>\n","\t<tr><th></th><th scope=col>work_year</th><th scope=col>job_title</th><th scope=col>job_category</th><th scope=col>salary_currency</th><th scope=col>salary</th><th scope=col>salary_in_usd</th><th scope=col>employee_residence</th><th scope=col>experience_level</th><th scope=col>employment_type</th><th scope=col>work_setting</th><th scope=col>company_location</th><th scope=col>company_size</th></tr>\n","\t<tr><th></th><th scope=col>&lt;int&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;int&gt;</th><th scope=col>&lt;int&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><th scope=row>1</th><td>2023</td><td>Data DevOps Engineer</td><td>Data Engineering              </td><td>EUR</td><td> 88000</td><td> 95012</td><td>Germany      </td><td>Mid