d-its-future/jobs_in_data.csv\") #reading the data\n","\n","head(jobs_data) # return the first rows"]},{"cell_type":"markdown","id":"118ebda7","metadata":{"papermill":{"duration":0.015476,"end_time":"2024-02-06T17:53:37.33371","exception":false,"start_time":"2024-02-06T17:53:37.318234","status":"completed"},"tags":[]},"source":["The data set contains 9,355 rows and 12 columns."]},{"cell_type":"markdown","id":"2a8b7bd3","metadata":{"papermill":{"duration":0.015399,"end_time":"2024-02-06T17:53:37.364464","exception":false,"start_time":"2024-02-06T17:53:37.349065","status":"completed"},"tags":[]},"source":["## The data set contains the following variables\n","\n","1. **work_year** - The year in which the data was collected.\n","2. **job_title** - The precise job title, such as 'Data Scientist', 'Data Engineer', or 'Data Analyst'.\n","3. **job_category** - A classification of job roles into broader categories to facilitate analysis.\n","4. **salary_currency** - The currency in which the salary is paid, for example, US dollars or euros.\n","5. **salary** - The annual gross compensation for the position in local currency.\n","6. **salary_in_usd** - The annual gross salary in US dollars (USD). This standard currency translation helps with global wage comparisons and studies.\n","7. **employee_residence** - The nation of residence of the employee.\n","8. **experience_level** - Determines the employee's professional experience level. Some common categories include 'Entry-level', 'Mid-level', 'Senior', and 'Executive'.\n","9. **employment_type** - Indicates the type of employment, such as 'full-time', 'part-time', or 'contract'.\n","10. **work_setting** - The work location or environment, such as 'Remote', 'In-person', or 'Hybrid'.\n","11. **company_location** - The country where the company is based.\n","12. **company_size** - The employer's company size, which is often classified as small (S), medium (M), or big (L)."]},{"cell_type":"markdown","id":"70cc0c00","metadata":{"papermill":{"duration":0.015288,"end_time":"2024-02-06T17:53:37.395414","exception":false,"start_time":"2024-02-06T17:53:37.380126","status":"completed"},"tags":[]},"source":["# DATA CLEANING\n","\n"]},{"cell_type":"raw","id":"10e2516c","metadata":{"papermill":{"duration":0.016056,"end_time":"2024-02-06T17:53:37.426756","exception":false,"start_time":"2024-02-06T17:53:37.4107","status":"completed"},"tags":[]},"source":["Here, I have checked for any duplicates in the data set. The dataset includes 4,014 duplicates. The duplication make sense because a single position/role may have the same work environment and salary in a particular country."]},{"cell_type":"code","execution_count":2,"id":"00e9ae5c","metadata":{"execution":{"iopub.execute_input":"2024-02-06T17:53:37.500502Z","iopub.status.busy":"2024-02-06T17:53:37.460996Z","iopub.status.idle":"2024-02-06T17:53:37.75892Z","shell.execute_reply":"2024-02-06T17:53:37.756665Z"},"papermill":{"duration":0.3192,"end_time":"2024-02-06T17:53:37.761488","exception":false,"start_time":"2024-02-06T17:53:37.442288","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["Number of duplicate rows:  4014 \n"]}],"source":["# Check for duplicates\n","duplicate_rows <- jobs_data[duplicated(jobs_data), ] #using the duplicated() function to identify duplicate rows\n","#print(duplicate_rows)\n","\n","# To count the number of duplicate rows using the nrow() function\n","num_duplicates <- nrow(duplicate_rows)\n","\n","# Print the number of duplicate rows\n","cat(\"Number of duplicate rows: \", num_duplicates, \"\\n\")"]},{"cell_type":"markdown","id":"c65b038a","metadata":{"papermill":{"duration":0.015706,"end_time":"2024-02-06T17:53:37.794072","exception":false,"start_time":"2024-02-06T17:53:37.778366","status":"completed"},"tags":[]},"source":["Here, I have checked for NA values in each column. And we can see below that there are none. "]},{"cell_type":"code","execution_count":3,"id":"5e8bbf9d","metadata