 to $450,000, with similar figures in USD, suggesting a wide variation in compensation across different jobs.\n","* Central Tendency: The average salary is slightly higher than the median, hinting at a distribution skewed by higher salaries.\n","* Distribution: The first and third quartiles of salaries indicate that the middle 50% of the data is well-distributed, with half of the salaries falling within a specific central range."]},{"cell_type":"code","execution_count":4,"id":"224508a4","metadata":{"execution":{"iopub.execute_input":"2024-02-06T17:53:37.920635Z","iopub.status.busy":"2024-02-06T17:53:37.918914Z","iopub.status.idle":"2024-02-06T17:53:37.946187Z","shell.execute_reply":"2024-02-06T17:53:37.944129Z"},"papermill":{"duration":0.049377,"end_time":"2024-02-06T17:53:37.949076","exception":false,"start_time":"2024-02-06T17:53:37.899699","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":["   work_year     job_title         job_category       salary_currency   \n"," Min.   :2020   Length:9355        Length:9355        Length:9355       \n"," 1st Qu.:2023   Class :character   Class :character   Class :character  \n"," Median :2023   Mode  :character   Mode  :character   Mode  :character  \n"," Mean   :2023                                                           \n"," 3rd Qu.:2023                                                           \n"," Max.   :2023                                                           \n","     salary       salary_in_usd    employee_residence experience_level  \n"," Min.   : 14000   Min.   : 15000   Length:9355        Length:9355       \n"," 1st Qu.:105200   1st Qu.:105700   Class :character   Class :character  \n"," Median :143860   Median :143000   Mode  :character   Mode  :character  \n"," Mean   :149928   Mean   :150300                                        \n"," 3rd Qu.:187000   3rd Qu.:186723                                        \n"," Max.   :450000   Max.   :450000                                        \n",