38.110878","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\n","Attaching package: ‘dplyr’\n","\n","\n","The following objects are masked from ‘package:stats’:\n","\n","    filter, lag\n","\n","\n","The following objects are masked from ‘package:base’:\n","\n","    intersect, setdiff, setequal, union\n","\n","\n"]},{"name":"stdout","output_type":"stream","text":["  work_year count proportion (%)\n","1      2023  7453           79.7\n","2      2022  1634           17.5\n","3      2021   197            2.1\n","4      2020    71            0.8\n"]}],"source":["library(dplyr)\n","total_rows <- nrow(jobs_data) #a variable with the total number of rows\n","\n","data_work <- jobs_data %>% \n","  count(work_year) %>% # count the number of occurrences (frequency) \n","  rename(count = n) %>% \n","  arrange(-count) %>% #sort the table by count\n","  mutate('proportion (%)' = round(count / total_rows * 100,1)) #frequency in %\n","\n","print(data_work)"]},{"cell_type":"markdown","id":"c8028cbe","metadata":{"papermill":{"duration":0.016278,"end_time":"2024-02-06T17:53:38.321497","exception":false,"start_time":"2024-02-06T17:53:38.305219","status":"completed"},"tags":[]},"source":["The output table summarizes job entries by year in the jobs_data dataset:\n","\n","* work_year: Lists years from 2020 to 2023.\n","* count: Shows the number of job entries per year, with a majority (7,453 or 79.7%) in 2023.\n","* proportion (%): Indicates the percentage of total entries per year, highlighting a significant concentration of data in 2023.\n","\n","The output highlights that the dataset is heavily skewed towards recent data, with nearly 80% of the entries coming from the year 2023. This distribution suggests that the dataset is particularly relevant for understanding the current state of job opportunities in the data field as of 2023.\n"]},{"cell_type":"markdown","id":"beab325c","metadata":{"papermill":{"duration":0.016858,"end_time":"2024-02-0