tle = element_text(size = 10), legend.title = element_text(size = 10), legend.text = element_text(size = 10)) # Resize the title, x and y labs elements\n"]},{"cell_type":"markdown","id":"d97205bd","metadata":{"papermill":{"duration":0.02167,"end_time":"2024-02-06T17:53:40.867589","exception":false,"start_time":"2024-02-06T17:53:40.845919","status":"completed"},"tags":[]},"source":["The heatmap depicts the average wage using a color spectrum ranging from yellow (lowest) to blue (highest). Each cell represents the average wage in thousands (k).\n","\n","Based on the heat map data, the following conclusions can be drawn:\n","\n","1. The salary improves with experience level, with the exception of the 'Data Analysis' category, where the 'Senior' level has an average salary of $120k and the 'Executive' level has an average salary of $110. For additional details on the 'Data Analyst' job category, please see the following section.\n","\n","2. The average income for entry-level roles is highest in the 'Data Science and Research' category at $101k, followed by 'Data Engineering' at $96k. However, the entry-level compensation for 'Data Analysis' is only $70k, which is $31k lower than the 'Data Science and Research' category. This shows a considerable difference.\n","\n","3. The highest wages are for the 'Executive' level roles of 'Machine Learning AI' ($207k) and 'Data Science and Research' ($204k).\n"]},{"cell_type":"markdown","id":"2c45f29c","metadata":{"papermill":{"duration":0.021328,"end_time":"2024-02-06T17:53:40.909766","exception":false,"start_time":"2024-02-06T17:53:40.888438","status":"completed"},"tags":[]},"source":["## Entry-level Data Analysis & Exploration\n"]},{"cell_type":"code","execution_count":18,"id":"fc4d2ea6","metadata":{"execution":{"iopub.execute_input":"2024-02-06T17:53:40.9567Z","iopub.status.busy":"2024-02-06T17:53:40.954942Z","iopub.status.idle":"2024-02-06T17:53:41.520423Z","shell.execute_reply":"2024-02-06T17:53:41.51751Z"},"papermill":{"durati