  labs(title = \"The Average Salary bar chart\", subtitle = \"for the Entry-level Data Analysis category grouped by Company Location\",\n","       x = \"Company Location\",\n","       y = \"Average Salary\"\n","       ) +\n","  theme_minimal() +\n","  guides(fill = \"none\") + \n","  theme(axis.text.x = element_text(angle = 90, vjust = 0.5, size = 14, face = \"bold\", color = \"black\"), axis.text.y = element_blank(), title = element_text(size = 14), legend.title = element_text(size = 18), legend.text = element_text(size = 14))"]},{"cell_type":"markdown","id":"4df31900","metadata":{"papermill":{"duration":0.024469,"end_time":"2024-02-06T17:53:42.07883","exception":false,"start_time":"2024-02-06T17:53:42.054361","status":"completed"},"tags":[]},"source":["Salaries for the 'Entry-level Data Analysis' subgroup are notably higher in the United States, averaging $77,000, outpacing other nations. Luxembourg and the United Kingdom are next, with average salaries of $59,000 and $58,000, respectively, and Germany is fourth at $54,000.\n","\n","It's important to consider the sample size from each country within this subgroup, as it might influence the robustness of the conclusions. Specifically, there are 103 entries from the United States, 10 from the United Kingdom, 2 from Germany, and 1 from Luxembourg. The validity of these findings may vary with future data updates and larger sample sizes."]},{"cell_type":"markdown","id":"d1403dd9","metadata":{"papermill":{"duration":0.024326,"end_time":"2024-02-06T17:53:42.127996","exception":false,"start_time":"2024-02-06T17:53:42.10367","status":"completed"},"tags":[]},"source":["**Trend of Average Salaries for entry level data analysts**"]},{"cell_type":"code","execution_count":20,"id":"a0c3cbc9","metadata":{"execution":{"iopub.execute_input":"2024-02-06T17:53:42.181636Z","iopub.status.busy":"2024-02-06T17:53:42.179799Z","iopub.status.idle":"2024-02-06T17:53:42.537767Z","shell.execute_reply":"2024-02-06T17:53:42.534477Z"},"papermill"