,"\n","#Creating a summary table grouped by work setting and company size\n","summary_table <- data_us %>%\n","  group_by(work_setting, company_size, experience_level) %>%\n","  summarize(average_salary = round(mean(salary_in_usd)),.groups = \"drop\")\n","\n","#Combining the columns company_size and work_setting into a single column to display on the heat map\n","summary_table <- summary_table %>%\n","  mutate(company_setting = paste(company_size, work_setting, sep = \" - \")) %>%\n","  select(-company_size, -work_setting) %>% \n","  select(company_setting, everything()) %>% \n","  arrange(desc(average_salary))\n","\n","options(repr.plot.width = 12, repr.plot.height = 10) #resize the plot \n","ggplot(summary_table, aes(x = experience_level, y = company_setting, fill = average_salary)) +\n","  geom_tile(color = \"white\", linewidth = 0.5) +  # Add borders to tiles\n","  geom_text(aes(label = scales::number_format(accuracy = 1, scale = 1e-3, suffix = \"k\")(average_salary)), vjust = 1, size = 6, fontface = \"bold\") +\n","  scale_fill_gradient(low = \"yellow\", high = \"blue\", name = \"Average Salary in USD\", labels = scales::number_format(accuracy = 1, scale = 1e-3, suffix = \"k\")) +  # Customize the color scale\n","  labs(title = \"Average Salary Heat Map: Data Analysis category in the United States\", subtitle = \"Grouped by experience level, company size and work setting\",\n","       x = \"Experience Level\",\n","       y = \"Company size / Work setting\") +\n","  theme_minimal() +\n","  theme(axis.text.x = element_text(size = 14, face = \"bold\", color = \"black\"), axis.text.y = element_text(size = 14,face = \"bold\", color = \"black\"), title = element_text(size = 14), legend.title = element_text(size = 18), legend.text = element_text(size = 14))"]},{"cell_type":"markdown","id":"71779b98","metadata":{"papermill":{"duration":0.030668,"end_time":"2024-02-06T17:53:44.03314","exception":false,"start_time":"2024-02-06T17:53:44.002472","status":"completed"},"tags":[]},"source":["The heat map analysis yields the following insights:\n","\n","Entry-level employees at small companies with hybrid work arrangements tend to have the lowest average salaries. Conversely, entry-level staff at medium-sized companies working on-site command the highest average salaries, reaching $82k for such positions.\n","\n","Senior Data Analysts employed full-time at large companies receive the top average salaries.\n","\n","The predominant determinant of average salary in the US appears to be the employee's experience level."]},{"cell_type":"markdown","id":"676d2cf3","metadata":{"papermill":{"duration":0.029631,"end_time":"2024-02-06T17:53:44.092488","exception":false,"start_time":"2024-02-06T17:53:44.062857","status":"completed"},"tags":[]},"source":["# KEY FINDINGS\n","* Experience level significantly impacts salary, with \"Machine Learning and AI\" roles showing a rise from $93k for entry-level to $207k for executive positions.\n","* Top paying fields include 'Machine Learning and AI', 'Data Science and Research', 'Data Engineering', and 'Leadership and Management'.\n","* 'BI and Visualization' offers higher average salaries compared to 'Data Analysis', despite similar skill sets.\n","* The US, UK, and Germany are top-paying countries for entry-level Data Analysts, with average salaries of $77K, $58k, and $57K respectively, not accounting for living costs.\n","* Work setting (in-person vs. remote) shows minimal impact on salaries, with entry-level positions averaging around $72k-$73k."]},{"cell_type":"markdown","id":"f25026fb","metadata":{"papermill":{"duration":0.02964,"end_time":"2024-02-06T17:53:44.152545","exception":false,"start_time":"2024-02-06T17:53:44.122905","status":"completed"},"tags":[]},"source":["The fields of \"Data Science and Research\" and \"Machine Learning and AI\" emerge as attractive career choices, offering not only competitive salaries from the outset but also a path rich in opportunities for advancement and job satisfaction, given their growing demand and developmental prospects.\n","\n","**Future Considerations:**\n","\n","* Cost of Living Adjustment: Introducing a cost of living column for each country can provide a more nuanced view, allowing for a comparison of salaries against local living expenses to identify the most economically advantageous locations for data analysts.\n","\n","* Enhancing Data Diversity: Addressing data imbalances by augmenting the dataset with more entries from less represented categories can offer a more comprehensive analysis. Promoting wider survey participation among data professionals across different specialties could diversify the data.\n","\n","* Tracking Industry Trends: Regular analysis updates, aligned with the dataset's weekly refreshes, can capture evolving industry trends. By consistently integrating new data and revisiting previous findings, a dynamic and up-to-date overview of the data job market can be maintained."]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":4404069,"sourceId":7563469,"sourceType":"datasetVersion"}],"dockerImageVersionId":30618,"isGpuEnabled":false,"isInternetEnabled":true,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":11.149167,"end_time":"2024-02-06T17:53:44.312078","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2024-02-06T17:53:33.162911","version":"2.5.0"}},"nbformat":4,"nbformat_minor":5}